var Todo = Backbone.Model.extend({
});


var Todos = Backbone.Collection.extend({
  model: Todo
});

var AppView = Backbone.View.extend({
 
  el: '.todo-app',

  events: {
    "submit #todo-form":    "create",
    "click .item":	    "go",
    "click .delete":        "remove"
  },

  initialize: function() {
    this.todos = new Todos();
    this.listenTo(this.todos, "add", this.render);
    this.listenTo(this.todos, "remove", this.render);
  },

  go: function (event) {
    event.preventDefault();
    var href = $(event.target).attr('href');
    route.navigate(href, {trigger: true});
  },

  create: function (event) {
    event.preventDefault();
    var title = $(event.target).find('[name=title]').val();
    if (title) {
      this.todos.add(new Todo({title: title}));
    }
  },

  remove: function (event) {
    event.preventDefault();
    var id = $(event.target).data('cid');
    this.todos.remove(id);
  },

  enable: function () {
    this.$el.show();
  },

  disable: function () {
    this.$el.hide();
  },

  template: $('#app-tmpl').html(),

  render: function() {
    var todos = [];
    this.todos.forEach(function (todo) {
      todos.push({
	id: todo.cid,
	title: todo.get('title')
      })
    })
    this.$el.html(Mustache.render(this.template, {todos: todos}));
  }

});

var appView = new AppView();

var ItemView = Backbone.View.extend({
 
  el: '.todo-item',

  enable: function () {
    this.$el.show();
  },

  disable: function () {
    this.$el.hide();
  },

  template: $('#todo-tmpl').html(),

  render: function (item) {
    console.log(this.template, item.toJSON())
    this.$el.html(Mustache.render(this.template, item.toJSON()));
  }

});

var itemView = new ItemView();

var AppRoute = Backbone.Router.extend({

  routes: {
    "": "default",
    "item/:id": "item"
  },

  default: function () {
    itemView.disable();
    appView.enable();
    appView.render();
  },

  item: function (id) {
    var item = appView.todos.get(id);
    appView.disable();
    itemView.enable();
    itemView.render(item);
  }

});


var route = new AppRoute();

Backbone.history.start({pushState: false});

